import React, {Component} from "react"
import Profile from "../components/Profile"

const TrailDetails = (props) => {
  console.log(props)

  const addToMyTrails = () => {
    return(
      <NavLink to="/profile" exact />
    )
  }


  return(
    <div>
      <p>{props.trail.name}</p>
      <button onClick={props.goBack}>Go back to all trails</button>
      <button onClick={()=>addToMyTrails()}>Mark as completed</button>
      <button>Save for later</button>
    </div>
  )
}


export default TrailDetails;
